ace.model<-"
A1=~ NA*P1 + c(a,a)*P1
A2=~ NA*P2 + c(a,a)*P2
C1 =~ NA*P1 + c(c,c)*P1
C2 =~ NA*P2 + c(c,c)*P2

A1 ~~ 1*A1
A2 ~~ 1*A2
C1 ~~ 1*C1
C2 ~~ 1*C2
P1~~c(e2,e2)*P1
P2~~c(e2,e2)*P2

A1 ~~ c(1,.5)*A2
A1 ~~ 0*C1 + 0*C2
A2 ~~ 0*C1 + 0*C2
C1 ~~ c(1,1)*C2



a2.std := a^2/(a^2 + c^2 + e2)
c2.std := c^2/(a^2 + c^2 + e2)
e2.std := e2/(a^2 + c^2 + e2)
"



ace.fit<-cfa(ace.model, data = dataset,group = "zyg")
summary(ace.fit)

lay <- get_layout("","","","",    "","","",
                  "A1","","C1","",    "A2","","C2",
                  ""  ,"P1","","",    ""  ,"P2","", rows = 3)
test_that("defined variables := are handled in multigroup case", {
  expect_error(get_edges(ace.fit), NA)
  expect_error(get_nodes(ace.fit), NA)
  expect_error(graph_sem(model = ace.fit,layout=lay,variance_diameter=.3,angle = 180,rect_height=.35,ellipses_height=.35,spacing_x=1,spacing_y=0.7), NA)
})
